import React from "react";
import ReactDOM from "react-dom";
import moment from "moment";

import  WeekSchedular  from "./components/WeekSchedular";

export const selectedEvents = [
  {
    start: moment()
      .add(1, "days")
      .hour(9)
      .minute(0),
    end: moment()
      .add(1, "days")
      .hour(10)
      .minute(0),
  },
  {
    start: moment()
      .add(1, "days")
      .hour(10)
      .minute(0),
    end: moment()
      .add(1, "days")
      .hour(12)
      .minute(0),
  },
  {
    start: moment()
      .add(2, "days")
      .hour(10)
      .minute(0),
    end: moment()
      .add(2, "days")
      .hour(11)
      .minute(0),
  },
];

const App = () => {
  return < WeekSchedular />;
};

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
